import styled from 'styled-components';

const Container = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	height: 89vh;
`;

const Heading = styled.h1`
	color: #00aaf4;
	font-size: 153px;
	line-height: 153px;
	margin: 0;
	font-weight: bold;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
`;

const SubHeading = styled.p `
	color: #00aaf4;
	font-size: 45px;
	margin: 0 0 60px 0px;
	font-weight: bold;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
`;

const SpeakerImg = styled.img `
	vertical-align: top;
`;

const PriceBlock = styled.div`
	display: inline;
	border-top: 1px solid #828e96;
	border-bottom: 1px solid #828e96;
	padding-top: 75px;
	padding-bottom: 70px;
`;

