const price = (props) => (
	<Container>
			<Heading>JBL Xtreme 2</Heading>
			<SubHeading>waterproof portable bluetooth speaker</SubHeading>
			<div>
				<SpeakerImg src="assets/images/xtreme2-group.png" alt="Three JBL Xtreme 2 speakers."/>
				<PriceBlock>
					<p><span class="hyper">$</span>299<span class="hyper">99</span></p>
				</PriceBlock>
			</div>

	</Container>
)

export default price;
